function convertToTensors(data, targets, testSplit) {
  /**
   * @param data array with data from the snake game. Head and Food position, Score and Distance
   * @param targets directions to predict - right, left, up, down
   * @param testSplit % to split the dataset into Train/Test sets
   */

  const numExamples = data.length;
  if (numExamples !== targets.length) {
    throw new Error("size error between data and split");
  }

  const numTestExamples = Math.round(numExamples * testSplit);
  const numTrainExamples = numExamples - numTestExamples;

  const xDims = data[0].length;

  // Create a 2D `tf.Tensor` to hold the feature data.
  const xs = tf.tensor2d(data, [numExamples, xDims]);

  // Create a 1D `tf.Tensor` to hold the labels, and convert the number label
  // from the set {0, 1, 2} into one-hot encoding (.e.g., 0 --> [1, 0, 0]).
  const ys = tf.oneHot(tf.tensor1d(targets).toInt(), DIRECTIONS_NUM_CLASSES);

  // Split the data into training and test sets, using `slice`.
  const xTrain = xs.slice([0, 0], [numTrainExamples, xDims]);
  const xTest = xs.slice([numTrainExamples, 0], [numTestExamples, xDims]);
  const yTrain = ys.slice([0, 0], [numTrainExamples, DIRECTIONS_NUM_CLASSES]);
  const yTest = ys.slice([0, 0], [numTestExamples, DIRECTIONS_NUM_CLASSES]);
  return [xTrain, yTrain, xTest, yTest];
}

function getSnakeData(testSplit) {
    return tf.tidy(() => {
        const dataByClass = [];
        const targetsByClass = [];

        for (let i = 0; i < DIRECTIONS_CLASSES.length; ++i) {
            dataByClass.push([]);
            targetsByClass.push([]);
        }

        for (const example of DIRECTIONS_DATA) {
            const target = example[example.length - 1];
            const data = example.slice(0, example.length - 1);
            dataByClass[target].push(data);
            targetsByClass[target].push(target);
      }

        const xTrains = [];
        const yTrains = [];
        const xTests  = [];
        const yTests   =[];

        for (let i = 0; i < DIRECTIONS_CLASSES.length; ++i){
            const [xTrain, yTrain, xTest, yTest] = convertToTensors(dataByClass[i], targetsByClass[i], testSplit);
            xTrains.push(xTrain);
            yTrains.push(yTrain);
            xTests.push(xTest);
            yTests.push(yTest);
        }

        const concatAxis = 0;
        return [
            tf.concat(xTrains, concatAxis), tf.concat(yTrains, concatAxis), tf.concat(xTests, concatAxis), tf.concat(yTests, concatAxis)
        ];
    });
}

let model;

async function trainModel(xTrain, yTrain, xTest, yTest){
    console.log('Training model... 200epoch - 10units ... Please wait.');

    const params = {epochs: 200, learningRate: 0.01 }
    const model = tf.sequential();
    model.add(tf.layers.dense({units:10, activation: 'sigmoid', inputShape: [xTrain.shape[1]]}));
    model.add(tf.layers.dense({units: 4, activation: 'softmax'}));

    const optimizer = tf.train.adam(params.learningRate);
    model.compile({optimizer: optimizer,
                    loss: 'categoricalCrossentropy',
                    metrics: ['accuracy'],
    });

    const lossValues = [];
    const accuracyValues = [];
    // model.fit to train model
    const history = await model.fit(xTrain, yTrain, {
        epochs: params.epochs,
        validationData: [xTest, yTest],
        callbacks: {
            onEpochEnd: async (epoch, logs) => {
                //console.log("loss:" + lossValues + ", epoch:" + epoch +", logs.loss:" + logs.loss +", logs.val_loss:" + logs.val_loss);
                //console.log("accuracy:" + accuracyValues + ", epoch:" + epoch + ", logs.acc:" + logs.acc + ", logs.val_acc:" + logs.val_acc);
                console.log(epoch);
                lossValues.push([logs.loss, logs.val_loss]);
                accuracyValues.push([logs.acc, logs.val_acc]);
                await tf.nextFrame();
            },
        }
    });

    var str = '';
    for (const example of lossValues) {
        str += '[' + example + '],';
        //console.log(example);
    }
    console.log(str);
    
    str = '';
    for (const example of accuracyValues) {
        str += '[' + example + '],';
        //console.log(example);
    }
    console.log(str);
    //console.log(lossValues);
    //console.log(accuracyValues);
    console.log('Model training complete');
    return model;
}   

